export default class AppContainer extends Component(props) {
	constructor(props){
		super(props)
		this.state = {
			data :[]

		}
	}
  // console.log('PROPS INSIDE APPBARContainer COMP:' ,props)
    componentDidMount() {
    	const { data } = this.props

    fetch('/assets')
    .then(res=> res.json() )
    .then(data => this.setState({ assets: data }))
  }

  render(){
  	  return (
	    <div>
	      <HeaderAppBar assets={this.props.assets}/> 
	   </div>  
  )}
}
